for example if your given these busy slots:
{"value":{"end":"2025-02-07T23:00:00.000Z","start":"2025-02-07T22:00:00.000Z"}}

and

{"value":{"end":"2025-02-08T01:00:00.000Z","start":"2025-02-08T00:00:00.000Z"}}

Meaning slots for 2pm - 3pm and 4pm - 5pm are booked.

